import React from 'react';
import './maillist.css';

export default function MailList() {
    return (
        <div class='mail-dets-list-content'>
            <div class='mail-dets-list'>
                <h4>Jothilingam doodleb.</h4>
                <h6>doodblue innovations | Interview Task | Front-End Developer(React.js)</h6>
            </div>
            <div class='mail-dets-list unread-mail-body'>
                <span className='sender-id'>Jothilingam doodleb.</span>
                <span className='mail-body'>doodblue innovations | Interview Task | Front-End Developer(React.js)</span>
            </div>
        </div>
    );
}
